import React from "react";
import { useState } from "react";
import "./popup.css";

function POPup(props) {
  const [show, setShow] = useState("show");
  const handleClick = () => {
    console.log("clicked");
    setShow(!show);
  };
  return (
    <div>
      <button onClick={handleClick}></button>
      <div className="popup">
        <span className={show ? "show" : "popuptext"} id="myPopup">
          Popup text...
        </span>
      </div>
    </div>
  );
}

export default POPup;
